import React from 'react';

const Footer = () => {
  return (
    <footer style={{ 
      textAlign: 'center', 
      padding: '2rem', 
      marginTop: '2rem',
      backgroundColor: '#f8f9fa',
      borderTop: '1px solid #dee2e6'
    }}>
      <strong>&copy; 2024 UrbanCart</strong> - Built for Learning
    </footer>
  );
};

export default Footer;
